style.css:
@-moz-document domain("blog.roblox.com")
{
  header .site-title a
  {
    display: block;
    height: 20px;
    width: 110px;
    text-indent: -9999em;
    background: transparent url(data:image/svg+xml;base64,) no-repeat center center;
    background-size: 110px 203px;
  }
}

@-moz-document domain("www.roblox.com"), domain("web.roblox.com")
{
  .icon-default-logo-r, .icon-logo-r
  {
    background-image: url(data:image/svg+xml;base64,);
    background-repeat: no-repeat;
    background-size: auto auto;
    width: 30px;
    height: 30px;
    display: inline-block;
    vertical-align: middle;
    background-size: 30px 30px;
  }

  .icon-default-logo, .icon-logo
  {
    background-image: url(data:image/svg+xml;base64,);
    background-repeat: no-repeat;
    background-size: auto auto;
    width: 118px;
    height: 30px;
    display: inline-block;
    vertical-align: middle;
    background-size: 118px 30px;
  }

  .robloxLogo
  {
    display: Block;
    -moz-box-sizing: border-box;
    box-sizing: border-box;
    background-image: url(https://images.rbxcdn.com/13b5bfbebee2d722a1f0d2af181ac561.png);
    background-size: 36px, 36px;
    width: 36px;
    height: 36px;
    padding-left: 36px;
  }

  .icon-logo-tagline-white
  {
    background-image: url(data:image/svg+xml;base64,);
    background-repeat: no-repeat;
    background-size: auto 170px;
    background-position: center;
    display: inline-block;
    width: 650px;
    height: 170px;
  }

  .icon-logo-tagline
  {
    background-image: url(data:image/svg+xml;base64,);
    background-repeat: no-repeat;
    background-size: auto 170px;
    background-position: center;
    display: inline-block;
    width: 650px;
    height: 170px;
  }
}

